import { ArchiveBoxArrowDownIcon, ConsumerIcon } from "../../Icons";

export const hospitalMenue = [
  {
    name: "Orgnaisation",
    href: "/orgnaisation",
    icon: ArchiveBoxArrowDownIcon,
    current: true,
  },
  { name: "Consumer", href: "/consumer", icon: ConsumerIcon, current: false },
];
